          schema TEXT;
          col TEXT;
          sql TEXT := '';
          column_names TEXT := '';
        BEGIN
          FOR col IN SELECT DISTINCT column_name FROM information_schema.columns
            WHERE table_name = my_table AND table_schema in (select schema_name from public.clients_client)
