--
-- Name: grants; Type: VIEW; Schema: test; Owner: -
--

CREATE VIEW test.grants AS
 SELECT d.amount,
    d.amount_currency,
    c.status,
    c.created,
    p.date_completed,
    p.date_approved,
    p.date_started
   FROM (((test.grant_management_grantdonor d
     JOIN test.activities_contributor c ON ((d.contributor_ptr_id = c.id)))
     LEFT JOIN test.grant_management_grantapplication a ON ((a.activity_ptr_id = c.activity_id)))
     LEFT JOIN test.grant_management_grantpayout p ON ((p.activity_id = c.activity_id)));


